import React, { Component } from 'react'
import { Fragment } from 'react/cjs/react.production.min';

export default class VehicleRadio extends Component {
  constructor(props) {
    super(props);
    this.vehicleID = 'vehicles-'+this.props.id
  }

  render() {
    return (
      <Fragment>
          <input type="radio" id={this.vehicleID} name={'vehicles_group_'+this.props.id} 
            value={this.props.vehicle} />
          <label htmlFor={this.vehicleID}>{this.props.vehicle}</label>
      </Fragment>
    )
  }
}
